import Link from "next/link";
import Head from "next/head";

const Header = () => (

    <Head>
      <meta charset="utf-8"/>
      <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
      <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
      <meta name="description" content="Jakarea Parvez -  Personal protfolio"/>
      <meta name="keywords" content="Jakarea Parvez, resume, cv, portfolio, personal, developer, web, laravel"/>
      <meta name="author" content="Jakarea Parvez"/>
      <meta name="apple-mobile-web-app-capable" content="yes"/>
      <title>Jakarea Parvez - Personal Portfolio Template</title>
      <script async src="https://www.googletagmanager.com/gtag/js?id=UA-108870603-1"></script>
      <script>
          window.dataLayer = window.dataLayer || [];
          function gtag(){dataLayer.push(arguments)}
          gtag('js', new Date());
          gtag('config', 'UA-108870603-1');
      </script>
      <link rel="shortcut icon" type="image/x-icon" href="favicon.ico"/>
      <link href="https://fonts.googleapis.com/css?family=Poppins:300,300i,400,400i,500,500i,600,600i,700,700i,800,800i" rel="stylesheet"/>
      <link href="static/plugin/bootstrap/css/bootstrap.min.css" rel="stylesheet"/>
      <link href="static/plugin/font-awesome/css/font-awesome.min.css" rel="stylesheet"/>
      <link href="static/css/style.css" rel="stylesheet"/>
      <link href="static/css/color/default.css" rel="stylesheet"/>
      <link href="static/css/added.css" rel="stylesheet"/>
    </Head>
);

export default Header;
